(ns simply-clojure.chapter15-phone-test
  (:require [clojure.test :as test]
            [simply-clojure.chapter15-phone :refer :all]
            [simply-clojure.helper    :as helper]))

(test/deftest test-first-combine-h
  (test/testing "Testing first-combine-h"
    (test/is (= ["da" "ea" "fa"] (first-combine-h "a" ["d" "e" "f"])))
    (test/is (= ["defa" "ghia"]  (first-combine-h "a" ["def" "ghi"])))))

(test/deftest test-first-combine-r
  (test/testing "Testing first-combine-r"
    (test/is (= ["da" "ea" "fa"] (first-combine-r "a" ["d" "e" "f"])))
    (test/is (= ["defa" "ghia"]  (first-combine-r "a" ["def" "ghi"])))))

(test/deftest test-higher-combine-h
  (test/testing "Testing higher-combine-h"
    (test/is (= ["ad" "bd" "cd" "ae" "be" "ce" "af" "bf" "cf"] (higher-combine-h ["a" "b" "c"] ["d" "e" "f"])))
    (test/is (= ["adef" "bdef" "cdef" "ajgk" "bjgk" "cjgk"]    (higher-combine-h ["a" "b" "c"] ["def" "jgk"])))))

(test/deftest test-higher-combine-r
  (test/testing "Testing higher-combine-r"
    (test/is (= ["ad" "bd" "cd" "ae" "be" "ce" "af" "bf" "cf"] (higher-combine-r ["a" "b" "c"] ["d" "e" "f"])))
    (test/is (= ["adef" "bdef" "cdef" "ajgk" "bjgk" "cjgk"]    (higher-combine-r ["a" "b" "c"] ["def" "jgk"])))))

(test/deftest test-build-lttr-list-from-num
  (test/testing "Testing build-lttr-list-from-num"
    (test/is (= [["a" "b" "c"] ["d" "e" "f"] ["g" "h" "i"] ["j" "k" "l"] ["m" "n" "o"] ["p" "q" "r" "s"] ["t" "u" "v"]] (build-lttr-list-from-num 2345678)))))

